<?php
	/*
	 * simple_html_dom.php library test
	 *
	 * Note:
	 *  looks for a library at ../lib
	 *  looks for a library at ..
	 */

	function _extract_line($line_number)
	{
		$file_handler=fopen(__FILE__, 'r');

		for($i=1; $i<$line_number; ++$i)
			fgets($file_handler);

		$output=fgets($file_handler);
		fclose($file_handler);

		return $output;
	}

	echo ' -> Including '.basename(__FILE__);
		if(is_file(__DIR__.'/../lib/'.basename(__FILE__)))
		{
			if(@(include __DIR__.'/../lib/'.basename(__FILE__)) === false)
			{
				echo ' [FAIL]'.PHP_EOL;
				exit(1);
			}
		}
		else if(is_file(__DIR__.'/../'.basename(__FILE__)))
		{
			if(@(include __DIR__.'/../'.basename(__FILE__)) === false)
			{
				echo ' [FAIL]'.PHP_EOL;
				exit(1);
			}
		}
		else
		{
			echo ' [FAIL]'.PHP_EOL;
			exit(1);
		}
	echo ' [ OK ]'.PHP_EOL;

	$failed=false;

	echo ' -> Testing library';
		if(
			md5(str_get_html(base64_decode(_extract_line(71)))
			->	find('table#wt-5hr tr.soft td', 0)
			->	plaintext)
			===
			'a6016faa91639a9638d1231d87803436'
		)
			echo ' [ OK ]'.PHP_EOL;
		else
		{
			echo ' [FAIL]'.PHP_EOL;
			$failed=true;
		}

	if($failed)
		exit(1);

	exit();
?>
